import {
    PageHeader,
} from 'antd'


export default function AddRecruitment() {
    return (
        <div>
            <PageHeader
                className="site-page-header"
                onBack={() => null}
                title="撰写纳新信息"
                subTitle="发挥你的文笔，吸引同学们的加入吧~"
            />
            AddRecruitment
        </div>
    )
}
